import React, { useEffect, useState } from 'react';
import Mainscreen from './components/Main_screen';

function App() {

   // States
  const [data, setData] = useState([]);
  const [optionValue, setOptionValue] = useState("");
  const [modelData, setModalData] = useState([]);


  return (
    <div>
      Hello From App.js
      <Mainscreen 
      data={data} optionValue={optionValue} modelData={modelData}
      setData={setData} setOptionValue={setOptionValue} setModalData={setModalData}
       />
    </div>
  );
}

export default App;
